        <p><strong>Empresa: </strong>{this.props.empresa}</p>
        <p><strong>Descrição:</strong> {this.props.descricao}</p>
        {/* <img src={this.props.foto} alt={'icone'}/> */}
      </div>
    )
  }
}

export default Experiencias;
